import React from "react";
import logo from "./logo.svg";
import { Menu, Row, Col, Input, Icon, Popover } from "antd";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="menuBar">
        <div className="logo">
          <a href="">Push Notification</a>
        </div>
        <div className="menuCon">
          <div className="rightMenu">
            <a href="">
              <Icon type="bell" spin />
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
